import React from 'react';
import "./Portfolio.css";
import ''
const Portfolio = () => {
  return (
    <section>
      <div className="header">
        <img 
          src="./logoOT.png" 
          alt="Option Tech Logo" 
          className="logo" 
        />
        <h1 className="company-name">Option Tech</h1>
        <h2 className="page-title">Demonstrativos</h2>
      </div>

      <div className="button-container">
        <a href="/" className="nav-button" id="btn1">Página Inicial</a>
        <a href="/relatorios" className="nav-button" id="btn2">Relatórios</a>
        <a href="/financeiro" className="nav-button" id="btn3">Financeiro</a>
        <a href="/recursos-humanos" className="nav-button" id="btn4">Recursos Humanos</a>
        <a href="/projetos" className="nav-button" id="btn5">Projetos</a>
        <a href="/documentacao" className="nav-button" id="btn6">Documentação</a>
        <a href="/suporte" className="nav-button" id="btn7">Suporte</a>
        <a href="/configuracoes" className="nav-button" id="btn8">Configurações</a>
        <a href="/contato" className="nav-button" id="btn9">Contato</a>
      </div>
    </section>
  );
};

export default Portfolio;
